INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (1154,'es','videoInterview',8,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/207/880','¡Enhorabuena, has completado el proceso completo de inscripción para el programa Generation Spain!\\nEl equipo de selección está ',0,1,0,1,1,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','Video entrevista',207,880,NULL,'**En esta prueba se te presentarán tres preguntas.**<br>Deberás grabarte desde cualquier dispositivo del que dispongas con cámara y micrófono *(móvil, ordenador, tablet..)*, respondiendo a las mismas<br>**El archivo deberá tener una duración de entre 3-5 minutos máximo.**<br>Las preguntas a responder serán las siguientes:<br>* ¿Por qué quieres participar en el programa Generation?<br>* ¿En qué áreas de la Programación Web te gustaría desarrollarte profesionalmente y qué podrías aportar?<br>* ¿Cuáles son tus objetivos profesionales a corto y a largo plazo?<br>**¡Te esperamos!**<br>¿Tienes dudas? Llámanos al 91 121 91 07 o escríbenos a seleccion@generation.org<br>','¡Enhorabuena, has completado el proceso completo de inscripción para el programa Generation Spain!\n\nEl equipo de selección está revisando tu candidatura. Nos pondremos en contacto contigo la semana antes del curso para comunicarte los resultados de selección. Por favor, revisa periódicamente tu correo y presta atención a tu teléfono móvil\n\n¡Mucha suerte!\nGeneration Spain',0,1,0,NULL,NULL);
