INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (1485,'mx','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=31&program=131&location=914',NULL,0,0,0,0,0,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','Registro',131,914,NULL,'<div ><h3> Formulario de registro para el curso de ventas y servicio al cliente </h3></div>\n<p style=\"padding-top:20px\">\n<div>\n  <strong>¿Qué es esta capacitación?</strong>\n  <ul style=\"list-style-type: disc; padding-left:15px; padding-top:15px\">\n    <li style=\"padding-left:5px\">Capacitación intensiva de 3 semanas (tiempo completo) </li>\n    <li style=\"padding-left:5px\">Te enseñarán habilidades cómo técnicas de venta</li>\n    <li style=\"padding-left:5px\"> Cubre mentalidades y comportamientos que te servirán para alcanzar el éxito profesional</li>	\n    <li style=\"padding-left:5px\"> Es completamente gratis, ¡no te vamos a pedir nada!</li>\n    <li style=\"padding-left:5px\"> Incluye un mentor dedicado que te ayudará a cambiar tu vida</li>\n  </ul></p>\n</div>\n</p>\n<p style=\"padding-top:15px\">\n<div>\n<a href=\"https://www.youtube.com/watch?v=nC2wBwOJsWE\"><p>Descubre qué es Generation Mexico</p></a>\n</div>\n</p>\n<p style=\"padding-top:15px\">\n<div>\n<strong>Requisitos</strong>\n<div>\n</p>\n<p style=\"padding-top:15px\">\n<ul style=\"list-style-type: disc; padding-left:15px; padding-top:5px\">\n<li>Tener entre 18 y 29 años</li>\n<li>Tener el certificado de preparatoria</li>\n<li>Estar desempleado y no estudiar, o estar empleado en el sector informal </li>\n</ul>\n</p>\n',NULL,0,1,0,NULL,NULL);
