INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (1504,'es','uploadFiles',4,'https://genrecruiting.generation.org/container/1/uploadFiles/:studentid/:token/223/920','Gracias por subir tus documentos acreditativos. El equipo de selección los revisará lo antes posible y se pondrá en contacto con',0,1,0,1,1,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','CV',223,920,NULL,'<br><br>A continuación, te pedimos que subas dos documentos para cumplir con los requisitos del programa: tu DNI y certificado de Garantía Juvenil.\r\n<br><br>La inscripción en el Sistema Nacional de Garantía Juvenil puede ser algo lenta. Si no estás inscrito, te recomendamos que empieces el proceso lo antes posible\r\n<br><br>**¡Ya estoy inscrito en Garantía Juvenil!**<br>Accede a la página de Garantía Juvenil con tus claves y en el apartado de notificaciones, descarga un documento actualizado que acredite que eres beneficiario<br><br>**Todavía no estoy inscrito**<br>¡Puedes hacerlo en tu Oficina de Empleo! Al formalizar la solicitud de inscripción en el Sistema de Garantía Juvenil recibirás un Acuse de Recibo (de forma inmediata), documento que confirma que has solicitado admisión. ¡Adjúntalo lo antes posible para que podamos valorar tu candidatura! Tras unos días recibirás el \"Certificado Oficial\", documento que confirma que has sido aceptado en Garantía Juvenil. Te pedimos que lo subas una vez que lo recibas, ya que será necesario para el primer día de clase<br><br>¿Tienes dudas? Llámanos al 91 121 91 07 o escríbenos a **seleccion@mckinseysocialinitiative.org**','Gracias por subir tus documentos acreditativos. El equipo de selección los revisará lo antes posible y se pondrá en contacto contigo en caso de incidencia en algún documento.\r\n\r\nA continuación, te invitamos a realizar unos tests básicos de selección\r\n\r\n¡Te esperamos!\r\nGeneration Spain',0,1,0,NULL,NULL);
