INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (1508,'es','videoInterview',8,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/223/920','Muchas Gracias por completar tu proceso. El equipo de Generation Spain se pondrá en contacto contigo.',0,1,0,1,1,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','Video entrevista',223,920,NULL,'<p>En esta prueba se te presentar&aacute;n tres preguntas.<br />Deber&aacute;s grabarte desde cualquier dispositivo del que dispongas con c&aacute;mara y micr&oacute;fono (m&oacute;vil, ordenador, tablet..), respondiendo a las mismas<br />El archivo deber&aacute; tener una duraci&oacute;n de entre 3-5 minutos m&aacute;ximo.<br />Las preguntas a responder ser&aacute;n las siguientes:<br />* &iquest;Por qu&eacute; quieres participar en el programa?<br />* &iquest;Por qu&eacute; deber&iacute;as ser seleccionado?<br />* &iquest;En qu&eacute; tipo de empresa te gustar&iacute;a desarrollarte y qu&eacute; podr&iacute;as aportar?<br />* &iquest;Cu&aacute;les son tus objetivos profesionales a corto y a largo plazo?<br />&iexcl;Te esperamos!<br />&iquest;Tienes dudas? Escr&iacute;benos a seleccion@generation.org&rdquo;<br />Video entrevista<br />Description: Sube un &uacute;nico archivo <br />Formato: apellido_nombre_video</p>','¡Enhorabuena, has completado el proceso completo de inscripción para el programa Generation Spain!\r\n\r\nEl equipo de selección está revisando tu candidatura. Nos pondremos en contacto contigo la semana antes del curso para comunicarte los resultados de selección. Por favor, revisa periódicamente tu correo y presta atención a tu teléfono móvil\r\n\r\n¡Mucha suerte!\r\nGeneration Spain',0,1,0,NULL,NULL);
