INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (1611,'mx','videoInterview',7,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/205/943',NULL,0,1,0,1,1,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','Entrevista video',205,943,NULL,'**Learn about Generation and tell us about your expectations: Watch and get to know what Generation has achieved through its programs and discuss your expectations; <br>**Instructions: Visit the website http://www.quierotrabajar.mx , watch the videos of our first graduates and then tell us about the following questions (Your video should last 30 seconds maximum):**<br><br>* 1.  What are your expectations with our graduating program? What do you think are the hardest topics and skill sets to learn? <br>* 2.  What are you future goals? How does being a java developer will help you achieve those dreams?','Muchas gracias por completar el proceso de registro al programa. Próximamente recibirás en tu correo dos enlaces que deberas terminar para poder comenzar el curso. ',0,1,0,NULL,NULL);
