INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (2470,'it','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=81&program=232&location=1040',NULL,0,0,0,0,0,0,0,NULL,'2019-02-16 00:22:35','2019-02-16 00:22:35','Registrazione',232,1040,NULL,'Registrandoti a questa pagina accederai al percorso di selezione Generation per il corso di formazione di 3 settimane che si svolgerà ad aprile a Roma. Al termine del corso i candidati avranno l’opportunità di sostenere un colloquio per la posizione di _Shop Advisor Junior_ presso l’Aeroporto di Fiumicino.\n\nUna volta registrato, svolgerai due test online, e ti sarà chiesto di compilare un pre-work per testare le tue attitudini e conoscenze. Se passerai tutti gli step di selezione, verrai poi contattato per un colloquio finale di persona.\n\nI partecipanti al corso che sosterranno e passeranno i colloqui come _Shop Advisor Junior_, saranno assunti con la seguente tipologia di contratto: Impiegato / CCNL Terziario, Distribuzione e Servizi / dal lunedì alla domenica con due giorni di riposo.\n\nCosa aspetti? Registrati e manda la tua candidatura!',NULL,0,0,0,NULL,NULL);
