INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (2613,'it','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=81&program=232&location=1055',NULL,0,0,0,0,0,0,0,NULL,'2019-03-29 21:31:16','2019-03-29 21:31:16','Registrazione',232,1055,NULL,'Registrandoti su questa pagina accederai al percorso di selezione Generation per il corso di formazione di 3 settimane che si svolgerà a Maggio a Roma.\n\nAl termine del corso i candidati avranno la garanzia di sostenere dei colloqui di lavoro con i negozi della Galleria Commerciale Porta di Roma. Il corso “Eccellenza nel punto Vendita”, è finalizzato a formare professionalità che interagiscono con il cliente, sia nel settore della moda che in quello della ristorazione.\n\nUna volta registrato/a, svolgerai due test online, e ti sarà chiesto di compilare un pre-work per testare le tue attitudini e conoscenze. Se passerai tutti gli step di selezione, verrai poi contattato per un colloquio finale di persona.\n\nCosa aspetti? Manda la tua candidatura!',NULL,0,1,0,NULL,NULL);
