INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (2633,'es','videoInterview',8,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/258/1058','Muchas Gracias por completar tu proceso. El equipo de Generation Spain se pondrá en contacto contigo.',0,1,0,1,1,0,0,NULL,'2019-04-08 21:40:01','2019-04-08 21:40:01','Video entrevista',258,1058,NULL,'**En esta prueba se te presentarán cuatro preguntas.**<br>Deberás grabarte desde cualquier dispositivo del que dispongas con cámara y micrófono *(móvil, ordenador, tablet..)*, respondiendo a las mismas<br>**El archivo deberá tener una duración de entre 3-5 minutos máximo.**<br>Las preguntas a responder serán las siguientes:<br>* ¿Por qué quieres participar en el programa Generation - Prosegur?<br>* ¿Por qué deberías ser seleccionado?<br>* ¿Por qué te interesa Ciberseguridad?<br>* ¿Objetivos profesionales a corto y largo plazo?<br>**¡Te esperamos!**<br>¿Tienes dudas? Escríbenos a seleccion@generation.org<br>','¡Enhorabuena, has completado el proceso completo de inscripción para el programa Generation Spain!\r\n\r\nEl equipo de selección está revisando tu candidatura. Nos pondremos en contacto contigo la semana antes del curso para comunicarte los resultados de selección. Por favor, revisa periódicamente tu correo y presta atención a tu teléfono móvil\r\n\r\n¡Mucha suerte!\r\nGeneration Spain',0,1,0,NULL,NULL);
