INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (2677,'es','videoInterview',5,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/210/1063','Muchas Gracias por completar tu proceso. El equipo de Generation Spain se pondrá en contacto contigo.',0,1,0,1,1,0,0,NULL,'2019-05-06 20:01:29','2019-05-06 20:01:29','Video entrevista',210,1063,NULL,'**En esta prueba se te presentarán tres preguntas.**<br>Deberás grabarte desde cualquier dispositivo del que dispongas con cámara y micrófono *(móvil, ordenador, tablet..)*, respondiendo a las mismas<br>**El archivo deberá tener una duración de entre 3-5 minutos máximo.**<br>Las preguntas a responder serán las siguientes:<br>* ¿Por qué quieres participar en el programa GenerationSpain - Atento? ¿Y qué esperas conseguir?<br>* Coméntanos una situación en la que hayas tenido que resolver un problema en el entorno laboral. ¿Cómo conseguiste resolverlo?<br>* ¿Qué habilidades crees que son importantes para desarrollar con éxito este nuevo rol?<br>* Háblanos de una situación de cambio en tus funciones en el trabajo que haya requerido un proceso y adaptación por tu parte. ¿Qué pasos seguiste? ¿Cómo te sentiste?<br>**¡Te esperamos!**<br>¿Tienes dudas? Escríbenos a seleccion@generation.org<br>',NULL,0,1,0,NULL,NULL);
