INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (2779,'it','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=81&program=263&location=1089',NULL,0,0,0,0,0,0,0,NULL,'2019-05-14 22:37:55','2019-05-14 22:37:55','Registrazione',263,1089,NULL,'Registrandoti su questa pagina accederai al percorso di selezione Generation per i corsi di formazione di 4 settimane che si svolgeranno a Milano. Il corso è organizzato con il supporto di Intesa San Paolo e coinvolge alcuni dei locali più importanti della città.\nIl corso “Food & Beverage” è finalizzato a formare professionalità che interagiscono con il cliente ed è organizzato da Generation Italy, una Fondazione no profit che ha l\'obiettivo di sostenere l\'occupazione giovanile sul territorio.\nUna volta registrato/a, svolgerai due test online e ti sarà chiesto di compilare un pre-work per testare le tue attitudini e conoscenze. Se supererai tutti gli step di selezione, verrai poi contattato/a per un colloquio finale di persona.\nCosa aspetti? Manda la tua candidatura!','',0,1,0,NULL,NULL);
