INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (3008,'it','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=81&program=232&location=1107',NULL,0,0,0,0,0,0,0,NULL,'2019-08-08 22:57:23','2019-08-08 22:57:23','Registrazione',232,1107,NULL,'Registrandoti su questa pagina accederai al percorso di selezione Generation per i corsi di formazione di 3 settimane che si svolgeranno in Campania (la sede del corso sarà o Napoli città o Marcianise).\nI corsi di formazione sono organizzati con il supporto di Intesa Sanpaolo e di alcuni dei Centri Commerciali più importanti del territorio (es., Campania).\nIl programma “Eccellenza nel punto Vendita” è finalizzato a formare professionalità che interagiscono con il cliente, ed è organizzato da Generation Italy, una Fondazione che ha l\'obiettivo di sostenere l\'occupazione sul territorio.\nUna volta registrato/a in questa pagina, svolgerai due test online, e ti sarà chiesto di compilare un pre-work per testare le tue attitudini e conoscenze. Se supererai tutti gli step di selezione, verrai poi contattato per un colloquio finale di persona.\nPotrai accedere dalla tua mail a questo percorso di selezione anche in momenti separati, una volta che avrai concluso uno degli step di selezione.\nCosa aspetti? Manda la tua candidatura.','',0,1,0,NULL,NULL);
