INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (3045,'it','registrationForm',1,'https://genrecruiting.generation.org/welcome?country=81&program=232&location=1124',NULL,0,0,0,0,0,0,0,NULL,'2019-05-16 22:33:41','2019-05-16 22:33:41','Registrazione',232,1124,NULL,'Registrandoti su questa pagina accederai al percorso di selezione Generation per i corsi di formazione di 7 settimane che si svolgeranno a Roma dedicati ad addetti vendite.<br><br>Le prime 3 settimane saranno dedicate a competenze di vendita generali, mentre le ultime 4 approfondiranno aspetti tecnici legati al settore del fai da te.<br><br>I corsi di formazione sono organizzati in collaborazione con Bosch, Manpower e Lablaw e coinvolgono alcune delle aziende più importanti della città.<br><br>Il programma “Eccellenza nel punto Vendita” è finalizzato a formare professionalità che interagiscono con il cliente, ed è organizzato da Generation Italy, una Fondazione che ha l\'obiettivo di sostenere l\'occupazione sul territorio.<br><br>Una volta registrato/a, svolgerai due test online, e ti sarà chiesto di compilare un pre-work per testare le tue attitudini e conoscenze. Se supererai tutti gli step di selezione, verrai poi contattato per un colloquio finale di persona.<br><br>Cosa aspetti? Manda la tua candidatura','',0,1,0,NULL,NULL);
