INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (3268,'es','videoInterview',8,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/211/1158','',0,1,0,1,1,0,0,NULL,'2019-12-02 18:16:01','2019-12-02 18:16:01','Video entrevista',211,1158,NULL,'**En esta prueba se te presentarán tres preguntas.**<br>Deberás grabarte desde cualquier dispositivo del que dispongas con cámara y micrófono *(móvil, ordenador, tablet..)*, respondiendo a las mismas<br>El archivo deberá tener una duración de entre 3-5 minutos máximo.<br>**Las preguntas a responder serán las siguientes:**<br>* ¿Por qué quieres participar en el programa Generation?<br>* ¿En qué áreas de Marketing Digital te gustaría desarrollarte profesionalmente y qué podrías aportar?<br>* ¿Cuáles son tus objetivos profesionales a corto y a largo plazo?<br>**¡Te esperamos!**<br>¿Tienes dudas? Escríbenos a seleccion@generation.org<br>Video entrevista<br>Description: Sube un único archivo<br>Formato: apellido_nombre_video','',0,1,0,NULL,NULL);
