INSERT INTO `` (`id`,`country`,`stageName`,`stageOrder`,`stageLink`,`assetUrl`,`allowsResubmission`,`needsReviewUnlessComplete`,`needsScheduleDate`,`hasScore`,`needsManualGrading`,`needsAggregateGrade`,`recruiterSide`,`aggregateGradeCutoffScore`,`createdAt`,`updatedAt`,`displayStageName`,`programId`,`locationId`,`screeningId`,`stageInstruction`,`defaultStatusExplanation`,`attemptsAllowed`,`isActive`,`allowNoShowStatus`,`ssStageId`,`ssRPId`) VALUES (4152,'es','videoInterview',8,'https://genrecruiting.generation.org/container/1/videoInterview/:studentid/:token/223/11094','',0,1,0,1,1,0,0,NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','Video entrevista',223,11094,NULL,'**En esta prueba se te presentarán tres preguntas.**<br>Deberás grabarte desde cualquier dispositivo del que dispongas con cámara y micrófono *(móvil, ordenador, tablet..)*, respondiendo a las mismas<br>**El archivo deberá tener una duración de entre 1-3 minutos máximo.**<br>Las preguntas a responder serán las siguientes:<br>* ¿Por qué quieres participar en el programa?<br>* ¿Por qué te interesa la programación y cloud computing?<br>* ¿En qué tipo de empresa te gustaría desarrollarte y qué podrías aportar?<br>* ¿Cuáles son tus objetivos profesionales a corto y a largo plazo?<br>**¡Te esperamos!**<br>¿Tienes dudas? Escríbenos a seleccion@generation.org<br>Video entrevista<br>Description: Sube un único archivo<br>Formato: apellido_nombre_video','',0,1,0,NULL,NULL);
